function besseljzero(k::Integer)
    besselj0_roots = (
        2.404825557695773, 5.520078110286311, 8.653727912911013, 11.791534439014281,
        14.930917708487787, 18.071063967910924, 21.21163662987926, 24.352471530749302,
        27.493479132040253, 30.634606468431976, 33.77582021357357, 36.917098353664045,
        40.05842576462824, 43.19979171317673, 46.341188371661815, 49.482609897397815,
        52.624051841115, 55.76551075501998, 58.90698392608094, 62.048469190227166
    )

    coefficients = (
        0.125,
        -0.08072916666666667,
        0.24602864583333334,
        -1.824438767206101,
        25.336414797343906,
        -567.6444121351834,
        18690.476528232066,
        -849353.5802991488,
        5.092254624022268e7
    )

    if k ≤ 20
        return besselj0_roots[k]
    else
        z = π * (k - 0.25)
        r = 1.0 / z
        r² = r^2
        z += r * @evalpoly(r², coefficients...)
        return z
    end
end

function besselj1squared(k::Integer)
    J1 = (
        0.2695141239419169, 0.11578013858220369, 0.07368635113640822,
        0.05403757319811628, 0.04266142901724309, 0.0352421034909961,
        0.030021070103054673, 0.02614739149530809, 0.023159121824691393,
        0.02078382912226786, 0.01885045066931767, 0.017246157569665008,
        0.0158935181059236, 0.01473762609647219, 0.013738465145387117,
        0.012866181737615133, 0.012098051548626797, 0.011416471224491609,
        0.010807592791180204, 0.010260372926280762, 0.009765897139791051
    )

    coefficients = (
        0.20264236728467555, 0.0, -0.00030338042971129027, 0.0001989243642459693,
        -0.00022896990277211166, 0.0004337107191307463, -0.0012363234972717543,
        0.004961014232688831, -0.026683739370232377, 0.18539539820634562
    )

    if k ≤ 21
        return J1[k]
    else
        x = 1.0 / (k - 0.25)
        x² = x^2
        return x * @evalpoly(x², coefficients...)
    end
end

struct GaussLegendrePair
    θ::Float64
    weight::Float64
end

Base.cos(pair::GaussLegendrePair) = cos(pair.θ)

function gauss_legendre_pair_calculated(n::Integer, k::Integer)
    v_n = 1.0 / (n + 0.5)
    j_0k = besseljzero(k)
    θ = v_n * j_0k
    x = θ^2
    B = besselj1squared(k)

    SF1T_coeffs = (-0.04166666666666663, 0.004166666666665193, -0.00014880952371390914, 2.7557316896206124e-6, -3.1314865463599204e-8, 2.4072468586433013e-10, -1.2905299627428051e-12)
    SF2T_coeffs = (0.008159722217729322, -0.02090222483878529, 0.0028211688605756045, -0.00025330032600823205, 1.6196925945383626e-5, -7.530367713737693e-8, 2.20639421781871e-9)
    SF3T_coeffs = (-0.041601216562020434, 0.012865419854284514, -0.002513952932839659, 0.0004184981003295046, -5.6779784135683305e-5, 5.558453302237962e-7, -2.9705822537552623e-8)
    
    WSF1T_coeffs = (0.08333333333333333, -0.0305555555555553, 0.004365079365075981, -0.0003262786595944122, 1.4964459362502864e-5, -4.639686475532213e-7, 1.037560669279168e-8, -1.752577007354238e-10, 2.3036572686037738e-12, -2.2090286104461664e-14)
    WSF2T_coeffs = (-0.011111111111121492, 0.002689594356947297, -0.00040729718561133575, 4.659695306949684e-5, -3.818179186800454e-6, 2.1148388068594716e-7, -7.129128572336422e-9, 7.676435450698932e-11, 3.631174121526548e-12)
    WSF3T_coeffs = (0.06569664899264847, -0.0009479693089585774, -0.0010564605025407613, -0.00042288805928292114, 0.00020055932639645834, -3.979333165191353e-5, 5.088983472886716e-7, -4.386471225202067e-8, 2.018267912567033e-9)
    
    SF1T = @evalpoly(x, SF1T_coeffs...)
    SF2T = @evalpoly(x, SF2T_coeffs...)
    SF3T = @evalpoly(x, SF3T_coeffs...)

    WSF1T = @evalpoly(x, WSF1T_coeffs...)
    WSF2T = @evalpoly(x, WSF2T_coeffs...)
    WSF3T = @evalpoly(x, WSF3T_coeffs...)

    j_0k_over_sin = j_0k / sin(θ)
    B_j_0k_over_sin = B * j_0k_over_sin
    WInvSinc = v_n^2 * j_0k_over_sin
    WIS2 = WInvSinc^2

    θ = v_n * (j_0k + θ * WInvSinc * (SF1T + WIS2 * (SF2T + WIS2 * SF3T)))
    denom = B_j_0k_over_sin + B_j_0k_over_sin * WIS2 * (WSF1T + WIS2 * (WSF2T + WIS2 * WSF3T))
    weight = 2.0 * v_n / denom

    return GaussLegendrePair(θ, weight)
end

function gauss_legendre_pair_tabulated(l::Integer, k::Integer)
    if isodd(l)
        l2 = (l - 1) ÷ 2
        if k == l2
            return GaussLegendrePair(π / 2, 2.0 / (Cl[l + 1]^2))
        elseif k < l2
            return GaussLegendrePair(OddThetaZeros[l2][l2 - k], OddWeights[l2][l2 - k])
        else
            return GaussLegendrePair(π - OddThetaZeros[l2][k - l2], OddWeights[l2][k - l2])
        end
    else
        l2 = l ÷ 2
        if k < l2
            return GaussLegendrePair(EvenThetaZeros[l2][l2 - k], EvenWeights[l2][l2 - k])
        else
            return GaussLegendrePair(π - EvenThetaZeros[l2][k - l2 + 1], EvenWeights[l2][k - l2 + 1])
        end
    end
end

function gauss_legendre_pair(n::Integer, k::Integer)
    n < k && throw(ArgumentError("n must be greater than or equal to k."))
    k ≤ 0 && throw(ArgumentError("k must be positive."))

    if n < 101
        return gauss_legendre_pair_tabulated(n, k - 1)
    else
        if (2k - 1) > n
            pair = gauss_legendre_pair_calculated(n, n - k + 1)
            return GaussLegendrePair(π - pair.θ, pair.weight)
        else
            return gauss_legendre_pair_calculated(n, k)
        end
    end
end

function gauss_legendre_pairs(n::Integer)
    pairs = Vector{GaussLegendrePair}(undef, n)
    
    for k in 1:n
        pairs[k] = gauss_legendre_pair(n, k)
    end
    
    return pairs
end

function gauss_legendre_integration(f; resolution::Integer = 128)
    integral = 0.0
    for k in 1:resolution
        pair = gauss_legendre_pair(resolution, k)
        integral += pair.weight * f(cos(pair.θ))
    end
    
    return integral
end

function gauss_legendre_integration(f, p; resolution::Integer = 128)
    integral = 0.0
    for k in 1:resolution
        pair = gauss_legendre_pair(resolution, k)
        integral += pair.weight * f(cos(pair.θ), p)
    end
    
    return integral
end
